The different mechs looked around the table at each other for a moment.

&quot;Um sir.&quot; FRACTYL said carefully and respectfully, &quot;You are the
commander, you tell us what you want us to do?&quot;

SKY SHADOW cleared his throat, &quot;If I may be so bold?&quot; he said in his
deep and almost over reverently respectful tones, &quot;You did say you
wanted to go after Cyclonus.&quot; He looked up at FRACTYL as he continued
to talk to HYDRAS, &quot;Your scientist has said that he has an approximate
location for Dark Rodimus.&quot;

There was a shrug from SKY SHADOW as he continued. &quot;We don&#39;t know if
they are working together or not, but they seem to have some sort of
connection.&quot; He smiled magnanimously, &quot;You could just go down and
search him out. I can watch the base for you until you return.&quot;

Meanwhile CRYOTEK watched SKY SHADOW with a clearly interested look on
his face and INFERNO just sat next to HYDRAS ready to follow any
command that was given.

TARATULUS sat in his chair looking at HYDRAS a wicked smile on his
face but saying nothing.

Behind the now quiet FRACTYL the map of the large jungle was still
being displayed on the screen.

